module HS65_LS_DFPRQX9(CP, D, RN, gnd, vdd, Q);
  input CP, D, RN, gnd, vdd;
  output Q;
  wire CP, D, RN, gnd, vdd;
  wire Q;
  wire next_state;
  reg  qi;
  assign #1 Q = qi;
  assign next_state = D;
  always 
    @(posedge CP or negedge RN) 
      if (!RN) 
